import React from "react";
import Popup from "reactjs-popup";
import lineQR from "../assets/lineQR.JPG";

function Footer() {
  return (
    <footer id="footer" className="text-black-50 fixed-bottom text-center">
      <div id="socialIcons">
        <a href="https://www.facebook.com/Memorydessert2017/">
          <i id="social-fb" className="fa fa-facebook-square fa-3x social"></i>
        </a>
        <a href="https://www.instagram.com/memory_dessert/">
          <i id="social-ins" className="fa fa-instagram fa-3x social"></i>
        </a>
        <Popup
          modal
          trigger={
            <a href="#">
              <i id="social-line" className="fa fa-weixin fa-3x social"></i>
            </a>
          }
        >
          <div className="modal">
            <img src={lineQR} alt="line-QRcode" />
          </div>
        </Popup>
      </div>
      <p className="text-center" id="copyRight" style={{ fontSize: "10px" }}>
        2020 Cooper Yeh &copy; BLUXURY CATERING
      </p>
    </footer>
  );
}

export default Footer;
